import React from 'react';

import Sidebar from 'react-sidebar';
import {NavItem} from 'react-bootstrap';

const sidebar = (props) => {
    return (
        <Sidebar
          sidebar={
              <>
            <NavItem>item 1</NavItem>
            <NavItem>item 1</NavItem>
            </>
            }
          open={props.open}
          onSetOpen={props.toggle()}
          styles={sidebar}
        >
        </Sidebar>
      );
};

export default sidebar;
